import React from 'react';

const ImageChangeOnMouseOver = () => (
  <div>
    <ImageToggleOnMouseHover src="/static/speakers/bw/Speaker-187.jpg" alt="" />
    &nbsp;&nbsp;&nbsp;
    <ImageToggleOnMouseHover src="/static/speakers/bw/Speaker-1124.jpg" alt="" />
  </div>
);

export default ImageChangeOnMouseOver;
